				<div class="et_pb_text_inner"><h1>Selamat Datang di<br />Website Desa Kuripan Kidul ?</h1>
<p>Permata tersembunyi yang menawarkan keaslian hidup di pedesaan dan keindahan alam yang tiada tara. Desa kami adalah kolaborasi sempurna antara tradisi dan modernitas, berlokasi di dataran rendah yang subur dengan latar belakang sawah yang hijau. Di sini, Anda dapat merasakan kehangatan komunitas lokal yang ramah, serta merasakan suasana pedesaan yang damai dan harmonis. Desa Kuripan Kidul, tempat di mana alam dan budaya berpadu dalam keindahan yang mempesona.</p></div>
			</div><div class="et_pb_button_module_wrapper et_pb_button_0_wrapper  et_pb_module">
				<a class="et_pb_button et_pb_button_0 et_pb_bg_layout_dark" href="/sejarah" data-icon="$">Baca Sejarah</a>
			</div>
